    static func samplesFromDatas(intervals: [TimeInterval], frequencies: [Double], amplitudes: [Double], leftAmplitudes: [Double], rightAmplitudes: [Double]) -> [AudioSample] {
        
        var i = 0
        let samples = intervals.map { interval -> AudioSample in
            let amplitude = amplitudes[i]
            let leftAmplitude = leftAmplitudes[i]
            let rightAmplitude = rightAmplitudes[i]
            let frequency = frequencies[i]
            i += 1
            return AudioSample(time: interval, amplitude: amplitude, rightAmplitude: rightAmplitude, leftAmplitude: leftAmplitude, frequency: frequency)
            
        }
        
        return samples
    }
